import React from 'react';

function Detail(props) {
    console.log(props.location.state);

    const { name, yearsOfWork, department } = props.location.state.employee;

    return (
        <article>
            <h1>DEtails</h1>
            <hr />
            {name} | {yearsOfWork} | {department}
        </article>
    );
}

export default Detail;
